import React, { Component } from 'react';

export default class Nav extends Component {
    render(){
        return(
            <nav className="nav-primary">
            <ul>
                {properBar}
                <li className="nav-links"><a href="grocerylist" data-value="grocerylist" onClick={props.click}>Pantry</a></li>
                <li className="nav-links left"><a href="home" data-value="home" onClick={props.click}>Home</a></li>
                {/* <li className="nav-links left"><a href="recipes" data-value="recipes" onClick={props.click}>Recipes</a></li> */}
            </ul>
        </nav>
        )
    }
}

let properBar;

if (localStorage.getItem('token')){
    properBar = <li className="nav-links"><a href="register" data-value="register" onClick={props.click}>profile</a></li>
}else{
    properBar = <React.Component>
                    <li className="nav-links"><a href="register" data-value="register" onClick={props.click}>Register</a></li>
                    <li className="nav-links"><a href="login" data-value="login" onClick={props.click}>Login</a></li>
                </React.Component>
}
